import { Component, AfterViewInit } from '@angular/core';

@Component({
  selector: 'app-counter-component',
  templateUrl: './counter.component.html'
})
export class CounterComponent implements AfterViewInit {
  public currentCount = 0;

  public incrementCounter() {
    this.currentCount++;
  }
  ngAfterViewInit() {
    // Wait for the Google Maps script to load
    window['initMap'] = this.initMap.bind(this);

    const script = document.createElement('script');
    script.src = `https://maps.googleapis.com/maps/api/js?key=YOUR_GOOGLE_MAPS_API_KEY&libraries=places&callback=initMap`;
    document.head.appendChild(script);
  }

  initMap() {
    const map = new google.maps.Map(document.getElementById('map') as HTMLElement, {
      center: { lat: -34.397, lng: 150.644 },
      zoom: 8,
    });
  }
}
<h1>Counter</h1>

<p>This is a simple example of an Angular component.</p>

<p aria-live="polite">Current count: <strong>{{ currentCount }}</strong></p>

<button class="btn btn-primary" (click)="incrementCounter()">Increment</button>
<div id="map"></div>
